import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMagnifyingGlass } from "@fortawesome/free-solid-svg-icons";
import couv from "./../assets/couv.jpg";
import w from "./../assets/waves.png";
import Texte from "./Texte";
import couv1 from './../assets/couv1.jpg';
import couv2 from './../assets/couv2.jpg';
import couv3 from './../assets/couv3.jpg';

const Welcome = () => {
  return (
    <div className="welcome">
      <Texte />

      <div className="container">
        <div className="container1"></div>

        <div className="couv">
          <img src={couv1} alt="" id="image1" />
          <img src={couv2} alt="" id="image2" />
          <img src={couv3} alt="" id="image3" />
        </div>
      </div>
    </div>
  );
};

export default Welcome;
